import React from "react";
import "../assets/styles/components/tile.css";

const Tile = props => {
  return (
    <section className="tile">
      <a href={props.link} target="_blank">
        <img
          src={require("../assets/images/tiles/" + props.logo + ".png")}
          alt={"logo " + props.logo}
        />
      </a>
    </section>
  );
};

export default Tile;
